vector<vector<int>>f(int n, vector <vector<int>> connections)
{
    vector<vector<int>> vr;

    vector<int> vt;
    map<int,int> mp;
    map<int,int> indxs;
    for(int i=0;i<connections.size();i++)
    {
        for(int j=0;j<2;j++)
        {
            int v=connections[i][j];
            vt.push_back(v);
            if(mp.find(v)!=mp.end())mp[v]++;
            else  mp[v]=1;

            indxs[v]=i;
        }
    }

    for(int i=0;i<vt.size();i++)
    {
        if(mp[vt[i]]==1)
        {
              vr.push_back(connections[indxs[vt[i]]]);
        }
    }
    return vr;
}

